import React from 'react'

const Header = () => {
  return (
    <div className="adri__header-section__padding" id='home'>
      <div className="adri__header-content">
        <h1 className="gradient__text">
          Welcome to Adrianne Borg's Space
        </h1>
      </div>
    </div>
  )
}

export default Header
